BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Item" (
	"ItemID"	INTEGER NOT NULL,
	"ProServiceID"	INTEGER NOT NULL,
	"ItemName"	TEXT,
	"Enabled"	INTEGER DEFAULT 1,
	PRIMARY KEY("ItemID" AUTOINCREMENT),
	FOREIGN KEY("ProServiceID") REFERENCES "ProfessionalService"("ProServiceID")
);
CREATE TABLE IF NOT EXISTS "ProfessionalService" (
	"ProServiceID"	INTEGER NOT NULL,
	"ProServiceName"	TEXT,
	"Enabled"	INTEGER DEFAULT 1,
	PRIMARY KEY("ProServiceID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Task" (
	"TaskID"	INTEGER NOT NULL,
	"ProServiceID"	INTEGER NOT NULL,
	"TaskName"	TEXT,
	"Enabled"	INTEGER DEFAULT 1,
	PRIMARY KEY("TaskID" AUTOINCREMENT),
	FOREIGN KEY("ProServiceID") REFERENCES "ProfessionalService"("ProServiceID")
);
CREATE TABLE IF NOT EXISTS "Client" (
	"ClientID"	INTEGER NOT NULL,
	"ClientName"	TEXT,
	"AddressLine1"	TEXT,
	"AddressLine2"	TEXT,
	"City"	TEXT,
	"State"	TEXT,
	"Zip"	TEXT,
	"Enabled"	INTEGER DEFAULT 1,
	"Rate"	INTEGER,
	PRIMARY KEY("ClientID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Record" (
	"RowID"	INTEGER NOT NULL,
	"Client"	TEXT,
	"ProService"	TEXT,
	"Task"	TEXT,
	"Item"	TEXT,
	"Date"	TEXT,
	"StartTime"	TEXT,
	"EndTime"	TEXT,
	"Hours"	TEXT,
	"ReimbursableCost"	TEXT,
	"Description"	TEXT,
	"Comments"	TEXT,
	"StartTimeOnly"	TEXT,
	"EndTimeOnly"	TEXT,
	"CreateDate"	TEXT,
	PRIMARY KEY("RowID" AUTOINCREMENT)
);
COMMIT;
